import React from "react";
import styled from "@emotion/styled";
import NotFoundJPG from "src/assets/404.jpg";

export const ImgDiv = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

export const NotFound: React.FC = () => {
  return <ImgDiv src={NotFoundJPG} />;
};
